import {React , useState}  from "react";


const Output = (props) => {

    return (
        <>
            <div>
                {
                    props.value.map((item,index) => {
                        <>
                        <label>Value: </label>
                        <li key={index}> {item}</li>  
                        </>
                    })
                }
            </div>
        </>
    )

}


export default Output
